import { StyleSheet } from 'react-native';
import Frame from '../components/Frame';
import ScrollingFrame from '../components/Frame';
import EditScreenInfo from '../components/EditScreenInfo';
import { Text, View } from '../components/Themed';

export default function TabTwoScreen() {
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Tab Two</Text>
      <View style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />
      <EditScreenInfo path="/screens/TabTwoScreen.tsx" />
      <ScrollingFrame size={100} gradient='linear-gradient(45deg, red, 50%, orange)' shadow={0.5} style={{ top: 0, left: 0, position: 'relative' }}>
        <Frame size={50} gradient='linear-gradient(45deg, pink, 50%, blue)' shadow={0.5} style={{ top: '50%', left: '50%', position: 'absolute', marginRight: '-50%', transform: 'translate(-50%, -50%)' }} />
      </ScrollingFrame>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '80%',
  },
});
